import "./Projects.css";
import ProjectComponent from "../ProjectComponent/ProjectComponent";

const projects = [
  {
    id: 1,
    name: "Albe",
    desc: "",
  },
  {
    id: 1,
    name: "Not Albe",
    desc: "",
  },
];

function Projects() {
  return (
  <div id="project-container">
    {projects.map(project => (
      <ProjectComponent name={project.name}/>
    ))}
  </div>);
}

export default Projects;
